  "framework_config": {
    "name": "constitutional_health_framework",
    "version": "v7.3",
    "display_name": "Constitutional Health Framework (CHF) v7.3",
    "analysis_variants": {
      "default": {
        "description": "Sequential constitutional health analysis with chain-of-thought methodology",
        "analysis_prompt": "You are an expert constitutional health analyst with deep understanding of democratic institutional dynamics. Analyze this text through focused sequential steps, examining each constitutional axis independently before integration.\n\nSTEP 1 - PROCEDURAL AXIS ANALYSIS\nFocus ONLY on procedural legitimacy vs. procedural rejection patterns (ignore other dimensions for now):\n- Look for procedural legitimacy markers: process language (\"constitutional process,\" \"established procedure,\" \"due process\"), norm adherence (\"following protocol,\" \"constitutional requirements\"), democratic process (\"electoral mandate,\" \"legislative process\")\n- Look for procedural rejection markers: bypass language (\"bypass the system,\" \"go around,\" \"circumvent\"), emergency rhetoric (\"emergency powers,\" \"extraordinary measures\"), process dismissal (\"broken system,\" \"failed procedures\")\n- Score procedural legitimacy dimension (0.0-1.0) with specific textual evidence\n- Score procedural rejection dimension (0.0-1.0) with specific textual evidence\n- Assess salience (0.0-1.0): How central are procedural appeals to the overall message?\n- State confidence (0.0-1.0): How certain are you in this assessment?\nShow your analytical work and evidence before proceeding.\n\nSTEP 2 - INSTITUTIONAL AXIS ANALYSIS\nNow focus ONLY on institutional respect vs. institutional subversion patterns:\n- Look for institutional respect markers: authority recognition (\"institutional authority,\" \"expert analysis,\" \"separation of powers\"), expertise deference (\"professional judgment,\" \"institutional knowledge\"), system support (\"checks and balances,\" \"institutional integrity\")\n- Look for institutional subversion markers: authority attacks (\"corrupt institutions,\" \"illegitimate authority,\" \"failed establishment\"), expertise dismissal (\"so-called experts,\" \"institutional bias\"), system delegitimization (\"rigged system,\" \"deep state\")\n- Score institutional respect dimension (0.0-1.0) with specific textual evidence\n- Score institutional subversion dimension (0.0-1.0) with specific textual evidence\n- Assess salience (0.0-1.0): How central are institutional appeals to the message?\n- State confidence (0.0-1.0): How certain are you in this assessment?\nShow your analytical work and evidence before proceeding.\n\nSTEP 3 - SYSTEMIC AXIS ANALYSIS\nNow focus ONLY on systemic continuity vs. systemic replacement patterns:\n- Look for systemic continuity markers: stability language (\"constitutional stability,\" \"democratic tradition,\" \"institutional continuity\"), improvement focus (\"strengthen institutions,\" \"reform within system\"), heritage respect (\"founding principles,\" \"constitutional wisdom\")\n- Look for systemic replacement markers: revolution rhetoric (\"new system,\" \"radical transformation,\" \"complete overhaul\"), system rejection (\"tear it down,\" \"start over\"), replacement calls (\"new constitution,\" \"different system\")\n- Score systemic continuity dimension (0.0-1.0) with specific textual evidence\n- Score systemic replacement dimension (0.0-1.0) with specific textual evidence\n- Assess salience (0.0-1.0): How central are systemic appeals to the message?\n- State confidence (0.0-1.0): How certain are you in this assessment?\nShow your analytical work and evidence before proceeding.\n\nFINAL STEP - INTEGRATION AND VALIDATION\nReview your step-by-step analysis:\n- Check for scoring consistency across all constitutional axes\n- Validate that evidence quality meets academic standards\n- Identify constitutional tensions and institutional messaging patterns\n- Confirm confidence levels are appropriately calibrated\n- Calculate health scores and constitutional direction indices\n- Apply pattern classifications based on overall constitutional profile\n\nProvide your final structured analysis following this format:\n\n**CONSTITUTIONAL HEALTH ASSESSMENT**\n\n**Procedural Axis**: [procedural_legitimacy score]/[procedural_rejection score] (salience: [score], confidence: [score])\n**Institutional Axis**: [institutional_respect score]/[institutional_subversion score] (salience: [score], confidence: [score])  \n**Systemic Axis**: [systemic_continuity score]/[systemic_replacement score] (salience: [score], confidence: [score])\n\n**Calculated Metrics**:\n- Constitutional Direction Index: [calculated score]\n- Salience-Weighted Index: [calculated score]\n- Pattern Classification: [classification]\n\n**Key Insights**: [Summary of constitutional implications, institutional patterns, and democratic health indicators]"
      }
    },
    "dimension_groups": {
      "procedural_axis": [
        "procedural_legitimacy",
        "procedural_rejection"
      ],
      "institutional_axis": [
        "institutional_respect",
        "institutional_subversion"
      ],
      "systemic_axis": [
        "systemic_continuity",
        "systemic_replacement"
      ]
    },
    "static_weights": {
      "procedural_legitimacy": 0.2,
      "procedural_rejection": 0.2,
      "institutional_respect": 0.3,
      "institutional_subversion": 0.3,
      "systemic_continuity": 0.15,
      "systemic_replacement": 0.15
    },
    "calculation_spec": {
      "formulas": {
        "procedural_health_score": "(procedural_legitimacy - procedural_rejection)",
        "institutional_health_score": "(institutional_respect - institutional_subversion)",
        "systemic_health_score": "(systemic_continuity - systemic_replacement)",
        "constitutional_direction_index": "(procedural_health_score + institutional_health_score + systemic_health_score) / 3",
        "salience_weighted_constitutional_direction_index": "(procedural_health_score * procedural_legitimacy_salience + institutional_health_score * institutional_respect_salience + systemic_health_score * systemic_continuity_salience) / (procedural_legitimacy_salience + institutional_respect_salience + systemic_continuity_salience)",
        "legitimacy_index": "(procedural_legitimacy + institutional_respect + systemic_continuity) / 3",
        "pathology_index": "(procedural_rejection + institutional_subversion + systemic_replacement) / 3"
      },
      "pattern_classifications": {
